func gcd(a, b int) int {
    for b != 0 {
        a, b = b, a%b
    }
    return a
}

func canTraverseAllPairs(nums []int) bool {
    n := len(nums)
    parent := make([]int, n)
    for i := range parent {
        parent[i] = i
    }

    var find func(x int) int
    find = func(x int) int {
        if parent[x] != x {
            parent[x] = find(parent[x])
        }
        return parent[x]
    }

    union := func(x, y int) {
        rootX := find(x)
        rootY := find(y)
        if rootX != rootY {
            parent[rootX] = rootY
        }
    }

    for i := 0; i < n; i++ {
        for j := i + 1; j < n; j++ {
            if gcd(nums[i], nums[j]) > 1 {
                union(i, j)
            }
        }
    }

    root := find(0)
    for i := 1; i < n; i++ {
        if find(i) != root {
            return false
        }
    }
    return true
}
